-- Indexes and sample view
CREATE INDEX IX_Orders_OrderDate ON Orders(OrderDate);
GO

CREATE VIEW vw_OrderSummary AS
SELECT o.OrderID, o.OrderDate, c.FirstName + N' ' + c.LastName AS CustomerName, e.FirstName + N' ' + e.LastName AS EmployeeName,
 SUM(od.Quantity * od.UnitPrice) AS TotalAmount
FROM Orders o
JOIN Customers c ON o.CustomerID = c.CustomerID
JOIN Employees e ON o.EmployeeID = e.EmployeeID
JOIN OrderDetails od ON od.OrderID = o.OrderID
GROUP BY o.OrderID, o.OrderDate, c.FirstName, c.LastName, e.FirstName, e.LastName;
GO
